import React from 'react'
import { Link } from 'react-router-dom'
import '../Profile.css'

export default function Sidebar() {
    const handleClick = (event) => {
        event.currentTarget.classList.add('bg-color')
    }
    const menu = [
        {
            url: '/profile/orders',
            name: 'Orders',
        },
    ]
    return (
        <div className='sidebar'>
            <Link to='/profile/orders' className='sidebar-item' onClick={handleClick}>
                Orders
            </Link>
            <Link to='/profile/favourites' className='sidebar-item'>
                Favourites
            </Link>
            <Link to='/profile/payments' className='sidebar-item'>
                Payments
            </Link>
            <Link to='/profile/addresses' className='sidebar-item' onClick={handleClick}>
                Addresses
            </Link>
        </div>
    )
}
